import Layout from './Layout';
import '../styles/home.css';

const Home = () => {
  return (
    <Layout>
      <div className='home-container'>
        <h1>Welcome to Our Recipe App</h1>
        <p>Discover the best recipes from Kenyan cuisine and more!
          <img src="../images/food.jpg" alt="Food" />
        </p>
      </div>
    </Layout>
  );
};

export default Home;
